
var game;
var gameLoaded = false;
var createOnLoaded = false;

window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],addFlag = false;
        
        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }

        this.picOne()
        this.graphics()
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    picOne(){
        var bg = this.add.image(0,0,'bg1').setOrigin(0,0)
    }
    graphics(){
        var position = []
        this.input.on('pointerdown',function (params) {
            this.graphics = this.add.graphics(0, 0)
            this.graphics.lineStyle(5, 0xaeb4c1, 1.0);
            // this.graphics.moveTo(params.x, params.y);
            this.graphics.beginPath();
            this.input.on('pointermove',function (pointer) {
                
                this.graphics.lineTo(pointer.x, pointer.y);
                this.graphics.strokePath();
                position.push({x:pointer.x,y:pointer.y})
                
            },this)
           this.input.on('pointerup',function () {
               console.log(this.graphics.lineStyle)
                // this.graphics.clear()
                this.graphics.lineStyle(0,0x000000)
                this.input.off('pointermove')
                this.input.off('pointerup')
                // this.graphics.x
                var maxX = position[0].x
                var minX = position[0].x
                var maxY = position[0].y
                var minY = position[0].y
                for (let i = 0; i < position.length-1; i++) {
                    maxX = maxX < position[i+1].x ? position[i+1].x : maxX
                    minX = minX > position[i+1].x ? position[i+1].x : minX
                    maxY = maxY < position[i+1].y ? position[i+1].y : maxY
                    minY = minY > position[i+1].y ? position[i+1].y : minY
                }
                console.log(maxX,maxY,minX,minY)

                if(minX<240 && 240<maxX && minY<470 && 470<maxY){
                    //距离目标点距离小于50
                    if(maxX-240<300 && 240-minX < 300 && 470-minY<170 && maxY-470<170){
                        // alert('圈中')
                        // this.graphics.
                    }
                    
                }else{

                }
                position = []
           },this)
        },this) 


        // this.input.on('pointerdown',function (params) {
        //     //画圆
        //     this.graphics = this.add.graphics(0, 0)
        //     this.graphics.lineStyle(5, 0xaeb4c1, 1.0)
        //     this.graphics.arc(params.x,params.y,10,0,0)
        // },this) 
        

    }

    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        }
        else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}

